import Layout from "../components/Layout";
import { initStore } from "../store";
import withRedux from "next-redux-wrapper";

const Index = () => (
  <Layout>
    <h1>Index page</h1>
    <p>It is a home page</p>
  </Layout>
);

export default withRedux(initStore, ({ posts }) => ({ posts }))(Index);
